import * as React from "react";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import MDButton from "components/MDButton";
import Typography from "@mui/material/Typography";
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';

export default function Alumni_card({ AlumniData }) {
  return (
    <ImageList sx={{ width: 500, height: 450 }}  gap={5} cols={3} rowHeight={250}>
      {AlumniData.map((data, index) => (

          <Card sx={{ Width: 345 }}>
            <CardMedia
              component="img"
              alt="alumni image"
              height="140"
              width="20"
              image="/images/alumni_images/page-bg-dark-1.jpg"
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
                NAME: {data.name}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Domain: {data.domain || "N/A"}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Company : {data.company || "N/A"}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Passout Year: {data.passoutYear || "N/A"}
              </Typography>
            </CardContent>
            <CardActions>
              <MDButton variant="contained" color="success">
                Request For a meeting
              </MDButton>
            </CardActions>
          </Card>

      ))}
    </ImageList>
  );
}
